import React from "react";
import { useParams } from "react-router-dom";
import img from '../../img/background.jpm'

const Detail = ()=>{
  const {id} = useParams()

  return(
    <div>
      <h1>Name of breed</h1>
      <h2>{`Height : 12-33`}</h2>
      <h2>{`Weight : 1-3`}</h2>
      <h2>{`life span : 10- 15 years`}</h2>
      <img src={img} alt='hola '/>
      
    </div>
  )
}

export default Detail;
